import React from "react";
import { Text, StyleSheet, View, Button, TouchableOpacity } from "react-native";

const HomeScreen = () => {
  return (
    <View>
      <Text style={styles.text}>HomeScreen</Text>
      <Button
        title='Go to Components Demo'   // text that is displayed
        onPress={() => {   // same as onClick!
          console.log('button pressed!')
        }}
      />
      {/* When a use touches a element inside the TouchableOpacity, you will get a onClick event */}
      <TouchableOpacity
        onPress={ ()=>{console.log('TouchableOpacity touched!')}}
      > 
        <Text>Go to List Demooo</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  text: {
    fontSize: 30
  }
});

export default HomeScreen;
